import React from 'react';

interface SearchResultsViewProps {
    results: any[];
}

const SearchResultsView: React.FC<SearchResultsViewProps> = ({ results }) => {
    return (
        <div>
            {results.map((result, index) => (
                <div key={result.id.videoId} style={{ padding: '10px', border: '1px solid #ccc', margin: '10px 0' }}>
                    <h3>{`Result Video ${index + 1} [Title: ${result.snippet.title}]`}</h3>
                    <p>{result.snippet.description}</p>
                    <img src={result.snippet.thumbnails.default.url} alt={result.snippet.title} />
                </div>
            ))}
        </div>
    );
};

export default SearchResultsView;
